=head1 DESCRIPTION

Represents a skipped analytics feature during the analysis of a call
analytics job.

The C<Feature> field indicates the type of analytics feature that was
skipped.

The C<Message> field contains additional information or a message
explaining why the analytics feature was skipped.

The C<ReasonCode> field provides a code indicating the reason why the
analytics feature was skipped.

